  deployer.yaml: |
    apiVersion: v1
    kind: Pod
    metadata:
      name: deployer-pod
      namespace: jenkins
      labels:
        app: deployer
    spec:
      containers:
      - name: tools
        image: ubuntu:20.04
        command:
        - sleep
        args:
        - "999999"
        volumeMounts:
        - name: kubeconfig
          mountPath: /root/.kube
        env:
        - name: DEBIAN_FRONTEND
          value: "noninteractive"
        lifecycle:
          postStart:
            exec:
              command:
              - /bin/sh
              - -c
              - |
                apt-get update && \
                apt-get install -y curl apt-transport-https gnupg && \
                curl -LO "https://dl.k8s.io/release/$(curl -L -s https://dl.k8s.io/release/stable.txt)/bin/linux/amd64/kubectl" && \
                chmod +x kubectl && mv kubectl /usr/local/bin/ && \
                curl https://baltocdn.com/helm/signing.asc | apt-key add - && \
                apt-get install -y software-properties-common && \
                apt-add-repository "deb https://baltocdn.com/helm/stable/debian/ all main" && \
                apt-get update && apt-get install -y helm
      volumes:
      - name: kubeconfig
        projected:
          sources:
          - secret:
              name: kubeconfig-secret
  docker-compose.yml: |
    version: '3.7'
    services:
      app:
        build:
          args:
            user: webuser
            uid: 1000
          context: ./
          dockerfile: Dockerfile
        image: ap-laravel
        container_name: ap-app
        restart: unless-stopped
        logging:
          options:
            max-size: "5k"
        ports:
          - '${FORWARD_VITE_PORT:-5173}:5173'
        working_dir: /var/www/
        volumes:
          - ./:/var/www
          - ./dev/docker-compose/php/app.ini:/usr/local/etc/php/conf.d/app.ini
        extra_hosts:
          # docker inspect ap-app | grep Gateway
          - host.docker.internal:host-gateway
        networks:
          - ap
        depends_on:
          - worker-local

      nginx:
        image: nginx:alpine
        container_name: ap-nginx
        restart: unless-stopped
        logging:
          options:
            max-size: "5k"
        ports:
          - '${FORWARD_NGINX_PORT:-80}:80'
        volumes:
          - ./:/var/www
          - ./dev/docker-compose/nginx:/etc/nginx/conf.d/
        networks:
          - ap

      worker-local:
        build:
          context: ./
          dockerfile: ./dev/docker-compose/worker-local/Dockerfile
          args:
            queueTimeout: 30
            queueTries: 2
            queues: default,indexing,notifications
        image: ap-worker-local
        container_name: ap-worker-local
        restart: unless-stopped
        logging:
          options:
            max-size: "5k"
        working_dir: /var/www/
        volumes:
          - ./:/var/www
          - ./dev/docker-compose/php/app.ini:/usr/local/etc/php/conf.d/app.ini
        extra_hosts:
            # docker inspect ap-app | grep Gateway
            - host.docker.internal:host-gateway
        networks:
          - ap

      mysql:
        image: mysql
        command: mysqld --sql_mode=""
        container_name: ap-mysql
        restart: unless-stopped
        logging:
          options:
            max-size: "5k"
        ports:
          - '${FORWARD_DB_PORT:-3306}:3306'
        environment:
          MYSQL_DATABASE: ${DB_DATABASE}
          MYSQL_ROOT_PASSWORD: ${DB_PASSWORD}
          MYSQL_PASSWORD: ${DB_PASSWORD}
          MYSQL_USER: ${DB_USERNAME} cannot use this anymore
          SERVICE_TAGS: dev
          SERVICE_NAME: mysql
        volumes:
          - ./dev/docker-compose/mysql:/docker-entrypoint-initdb.d
          #- ./dev/docker-compose/mysql/mysqld.cnf:/etc/mysql/mysql.conf.d/mysqld.cnf:delegated
        networks:
          - ap

      redis:
        build:
          context: ./
          dockerfile: ./dev/docker-compose/redis/Dockerfile
        #image: 'redis:alpine'
        privileged: true
        command: sh -c "/redis/init.sh"
        volumes:
          - ./dev/docker-compose/redis/redis.conf:/usr/local/etc/redis/redis.conf
          #- ./dev/docker-compose/redis/init.sh:/redis/init.sh
        restart: unless-stopped
        container_name: ap-redis
        ports:
          - '${FORWARD_REDIS_PORT:-6379}:6379'
        networks:
          - ap
        logging:
          options:
            max-size: "5k"
        healthcheck:
          test: [ "CMD", "redis-cli", "ping" ]

    networks:
      ap:
        driver: bridge
  instructions: |-
    docker build -t ap-worker-local -f dev/docker-compose/worker-local/Dockerfile . --no-cache

    docker compose --env-file .env up -d
  kaniko-builder.yaml: |-
    kind: Pod
    spec:
      containers:
      - name: kaniko
        image: gcr.io/kaniko-project/executor:debug
        imagePullPolicy: Always
        command:
          - sleep
        args:
          - 9999999
        env:
          - name: AWS_ACCESS_KEY_ID
            valueFrom:
              secretKeyRef:
                name: aws-credentials
                key: AWS_ACCESS_KEY_ID
          - name: AWS_SECRET_ACCESS_KEY
            valueFrom:
              secretKeyRef:
                name: aws-credentials
                key: AWS_SECRET_ACCESS_KEY
          - name: AWS_DEFAULT_REGION
            value: "us-east-1"
        volumeMounts:
          - name: aws-credentials
            mountPath: /root/.aws
            readOnly: true
      volumes:
        - name: aws-credentials
          secret:
            secretName: aws-credentials
